mapper.update:
update BS_AST_CARD
set 
  ZICMC = #{zicmc,jdbcType=VARCHAR}
where RWID = #{rwid,jdbcType=VARCHAR}

mapper.select:
select * from ( select t.*, ROWNUM rn from ( select * from BS_AST_CARD) t
where ROWNUM < #{endIndex})
where rn >= #{fromIndex}

